@sapoensaboad0 Já que tá todo mundo contando histórias, vamos lá.

Meu bisavô paterno era um coronel poderoso na Bahia. A filha dele, minha avó, a preferida, se casou e na festa um cara matou outro por uma dívida.

Meu biso deu dois bezerros pro delegado matar o cara que atrapalhou a festa.

